import React, { Fragment } from 'react';
import spinner from './spinner.gif';

const Spinner = () => (
  <Fragment>
    <img
      src={spinner}
      alt='Loading...'
      style={{ height: '200px', display: 'block', margin: 'auto' }}
    />
  </Fragment>
);

export default Spinner;
